import React, { Component } from "react";
let p = (text) => console.log(text);

class Post extends Component {
  render() {
    let post = this.props.post;
    return (
      <div className="post">
        <Button onClick={p(post.id)}>
          <h2>Id : {post.id}</h2>
          <h2>Title : {post.title}</h2>
          <h2>Author : {post.author}</h2>
        </Button>
      </div>
    );
  }
}

export default Post;
